```cpp
#include <iostream>
#include <string>
#include <fstream>
#include <regex>

using namespace std;

int main() {

  string website_content = // get website content using curl or a web scraper library

  regex phone_regex("\\d{3}-\\d{3}-\\d{4}"); 
  smatch phone_match;  
  ofstream phone_numbers("phone_numbers.txt");

  while(regex_search(website_content, phone_match, phone_regex)) {
    phone_numbers << phone_match[0] << endl; 
    website_content = phone_match.suffix().str();
  }

  phone_numbers.close();

  return 0;
}
```

The key steps are:

1. Get the website content into a string variable (many libraries can do this)
2. Use a regex to match phone number patterns like 123-456-7890
3. Loop through and extract each match into a text file 
4. Write the matches to the text file phone_numbers.

