Here is some code to safely handle power and square root operations in JavaScript, including handling negative numbers:

```js
// Safe power function
function safePow(base, exp) {
  if (exp < 0) {
    // Negative exponents don't make sense with negative bases
    if (base < 0) {
      return NaN; 
    }

    // Handle negative exponent
    base = 1 / base;
    exp = -exp;
  }

  return Math.pow(base, exp);
}

// Safe square root
function safeSqrt(num) {
  if (num < 0) {
    return NaN;
  }

  return Math.sqrt(num);
}

// Usage examples
let avgTemp = -5; 
let days = 10;

// Average squared 
let avgTempSquared = safePow(avgTemp, 2); 

// Standard deviation 
let stdDev = safeSqrt(safePow(avgTemp - avgTempSquared, 2) / (days - 1));
```

This checks for negative bases and exponents in the power function and returns NaN to avoid complex numbers. The square root function returns NaN for negative numbers.

