Yes, there are a few ways to execute remote shell commands from a PHP script:

1. Use SSH: The PHP ssh2 extension allows you to connect to remote servers via SSH and execute commands. For example:

```php
$ssh = ssh2_connect('remote_host', 22);
ssh2_auth_password($ssh, 'username', 'password'); 

$stream = ssh2_exec($ssh, 'ls -l');
$output = stream_get_contents($stream);
```

2. Use system() and ssh: You can execute a remote command by passing it to system() with ssh:

```php
system('ssh user@host "ls -l"'); 
```

3. Use exec() and ssh: Similar to system(), but executes asynchronously:

```php
exec('ssh user@host "ls -l" > output.txt');
```

4. Install a remote PHP script: Upload a PHP script to the remote server that executes the command when visited via URL.

So in summary, the ssh2 extension provides the most flexibility, but system/exec with ssh also works for simple remote execution.

