Here is a Python script that uses the `fuser` command on Linux or the `handle.exe` utility on Windows to remove files and directories in use by a specific process:

```python
import os
import subprocess

def remove_in_use_files(process_id):
    if os.name == 'nt':
        # On Windows, use handle.exe
        output = subprocess.check_output(['handle.exe', '-p', str(process_id), '-c'])
        for line in output.splitlines():
            parts = line.split()
            if parts[0] == 'File:':
                path = parts[1]
                os.remove(path) 
    else:
        # On Linux, use fuser
        output = subprocess.check_output(['fuser', '-k', '-TERM', '-m', str(process_id)])
        for line in output.decode().splitlines():
            path = line.strip()
            if os.path.exists(path):
                os.remove(path)

if __name__ == '__main__':
    process_id = 12345 
    remove_in_use_files(process_id)
```

