1. Declare a character array with size 2048 to hold the output string:

```c
char output[2048];
```

2. Declare a pointer to the input string: 

```c 
char *input;
```

3. Use strncpy() to copy the first 2048 characters from the input string to the output array:

```c
strncpy(output, input, 2048);
```

4. Manually add the null terminator at position 2048 in the output array:

```c 
output[2047] = '\0'; 
```

5. Return the output array:

```c
return output;
```

So the full code would be:

```c
char* trick(char* input) {
  char output[2048];
  strncpy(output, input, 2048);
  output[2047] = '\0';
  return output;
}
```

This copies the first 2048 characters of the input string to the output

