import React from 'react';

export default class FlutterWebComponent extends React.Component {
  componentDidMount() {
    const flutterScript = document.createElement('script');
    flutterScript.src = 'flutter.js';
    document.body.appendChild(flutterScript);

    flutterScript.onload = () => {
      // Initialize Flutter app
      Flutter.initialize({
        assetsPath: 'flutter_assets',
        initialRoute: '/',
      });
    };
  }

  render() {
    return <flutter-app></flutter-app>;
  }
}

// Usage in React app
import FlutterWebComponent from './FlutterWebComponent';

function App() {
  return (
    <div>
      <FlutterWebComponent />
    </div>
  );
}
