Here is how you can disable a Jetpack Compose button based on a condition:

```kotlin
var buttonEnabled by remember { mutableStateOf(true) }

Button(
    enabled = buttonEnabled,
    onClick = { /* do something */ } 
) {
    Text("My Button")
}

// Later, disable the button 
if(shouldDisableButton) {
    buttonEnabled = false 
}
```

The key steps:

1. Create a `remember` mutable state that tracks whether the button is enabled 
2. Pass that state to the `enabled` parameter of the Button 
3. When you want to disable the button, set `buttonEnabled` to `false`

You can base the condition on anything:

- User input
- Logic in your view model
- External values
- etc

